    "Reproductive ecology of seabirds at Middleton Island, Alaska (with notes on other
    species), 12-17 August 1981: Trip report",nt"tracking_summary": {ntt"total":
    4,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T23:02:23.040005",nt"name": "reproductive-ecology-of-seabirds-at-middleton-island-alaska-with-notes-on-other-species-12",nt"isopen":
    false,nt"url": null,nt"notes": "The objectives of the second visit to Middleton
    Island during the 1981 breeding season were threefold. First, we wanted to obtain
    data on hatching and fledging success of Pelagic Cormorants and Black-legged Kittiwakes,
    comparing our information to that obtained by Gould and Zabloudil (1981) in June.
    Second, we wanted to test the simulation model of Amos and Baird (USFWS unpublished.
    data) to verify if short-term monitoring studies will yield usable data with which
    we can predict population trends. Third, we wanted to band a cohort of murre chicks
    in anticipation of future studies being conducted on Middleton. With an age-class
    banded each year, we will be able to create life tables for this species and learn
    much about longevity and mortality rates. In addition, we wanted to conduct beached
    bird and mammal surveys and coastal bird surveys, respectively, to obtain a baseline
    count of dead birds and marine mammals and to document abundance and distribution
    of all birds found along the coast at Middleton.",nt"license_title": "License
